import React, { useState, useEffect } from 'react'
import { useParams } from 'react-router-dom';
import notes from './NotesListPage'

const NotePage = ({ match }) => {

  let { id } = useParams();
  
  let getNote = async () => {
    fetch(`/api/notes/${id}/`)
  }

  return (
    <div>
        <h1>Single {id}</h1>
    </div>
  )
}

export default NotePage
